  jQuery(function() {
    $("#filter_form, #referal_filter_form,#participant_list, #user_filter_form, #organizer_filter_form, #contributor_filter_form, #affiliates_filter_form, #sponsor_filter_form").submit(function() {
      $(":input").each(function() {
        return $(this).val($.trim($(this).val()));
      });
      return true;
    });
    $(".sort-icon").on("click", function() {
      var sortName, sortType;
      sortName = $(this).attr("sort-name");
      sortType = $(this).attr("sort-type");
      $("#sort_name").val(sortName);
      $("#sort_type").val(sortType);
      return $(this).parents().find('form').submit();
    });
    $(".sort-reg-users").on("click", function() {
      var sortName, sortType;
      sortName = $(this).attr("sort-name");
      sortType = $(this).attr("sort-type");
      $("#sort_name").val(sortName);
      $("#sort_type").val(sortType);
      return $(this).parents().find('form#sortRegUser').submit();
    });
    $(".sort-icon-affiliate").on("click", function() {
      var sortName, sortType;
      sortName = $(this).attr("sort-name");
      sortType = $(this).attr("sort-type");
      $("#sort_name").val(sortName);
      $("#sort_type").val(sortType);
      return $(this).parents().find('form#sortAffiliateForm').submit();
    });
    return $('th').on("click", function() {
      var parentClass, sortName, sortType;
      parentClass = $(this).parent().attr('class');
      sortName = $(this).children('img:visible').first().attr('sort-name');
      sortType = $(this).children('img:visible').first().attr('sort-type');
      $("#sort_name").val(sortName);
      $("#sort_type").val(sortType);
      if (sortName && sortType) {
        if (parentClass === "reg-user-tr") {
          return $(this).parents().find('form#sortRegUser').submit();
        } else if (parentClass === "affiliate-tr") {
          return $(this).parents().find('form#sortAffiliateForm').submit();
        } else {
          return $(this).parents().find('form').submit();
        }
      }
    });
  });

