var gift_coupons = {}
    var tmp_gift_coupons = {}

    function additem() {
        var textvalue;
        textvalue = $("#additemtext").val();
        $('.itemli').append('<li class="col-md-12 col-sm-12 col-xs-12 mt20" ><input type="button" value="-" class="qtyminus col-md-2 col-sm-2 col-xs-2" field="' + textvalue + '" /><label class="col-md-5 col-xs-8 col-sm-5 text-center"><input type="text" name="' + textvalue + '" value="0" data-qtytype="' + textvalue + '" class="qty hidden"/>' + textvalue + '</label><input type="button" value="+"  class="qtyplus col-md-2" field="' + textvalue + '" /></li>');
        $('.item-left-ul').append('<li class="hidden" data-type="' + textvalue + '"><span class="tobeadded"></span>' + textvalue + '</li>');
        $('.qtyplus').click(function(e) {
            e.preventDefault();
            fieldName = $(this).attr('field');
            var currentVal = parseInt($('input[name="' + fieldName + '"]').val());
            if (!isNaN(currentVal)) {
                $('input[name="' + fieldName + '"]').val(currentVal + 1);
            } else {
                $('input[name="' + fieldName + '"]').val(0);
            }
        });
        $(".qtyminus").click(function(e) {
            e.preventDefault();
            fieldName = $(this).attr('field');
            var currentVal = parseInt($('input[name="' + fieldName + '"]').val());
            if (!isNaN(currentVal) && currentVal > 0) {
                $('input[name="' + fieldName + '"]').val(currentVal - 1);
            } else {
                $('input[name="' + fieldName + '"]').val(0);
            }
        });

        $('.addsec .qtyplus,.addsec .qtyminus').click(function() {
            var ele = $(this).attr('field');
            //console.log($('[data-qtytype="'+ele+'"]').val())
            var cnt = $('[data-qtytype="' + ele + '"]').val();
            if (cnt != 0) {
                $('[data-type="' + ele + '"]').removeClass('hidden')
                $('[data-type="' + ele + '"] .tobeadded').html(cnt)
            } else {
                $('[data-type="' + ele + '"]').addClass('hidden')
                $('[data-type="' + ele + '"] .tobeadded').html("")
            }
            pushToHash(fieldName, cnt);
        });

        function pushToHash(fieldName, cnt) {
            tmp_gift_coupons[fieldName] = cnt
            $.extend(gift_coupons, tmp_gift_coupons)
            var tmp_coupons = gift_coupons
            tmp_coupons = JSON.stringify(tmp_coupons)
            $('.gift-coupon-hash').val(tmp_coupons);
        }
    }
