    // Event name filter for contributor
    var availableTags = [];

    function split(val) {
        return val.split(/,\s*/);
    }

    function extractLast(term) {
        return split(term).pop();
    }
    $("#event-name")
        // don't navigate away from the field on tab when selecting an item
        .on("keyup", function(event) {
            if (event.keyCode === $.ui.keyCode.TAB &&
                $(this).autocomplete("instance").menu.active) {
                event.preventDefault();
            }
            if ($(this).val().length >= 1) {
                $.ajax({
                    type: "get",
                    url: "/contributors/get_events",
                    data: {
                        name: $.trim($(this).val())
                    },
                    dataType: 'json',
                    success: function(data) {
                        availableTags = data
                    }
                });
            }
        })
        .autocomplete({
            minLength: 0,
            source: function(request, response) {
                // delegate back to autocomplete, but extract the last term
                response($.ui.autocomplete.filter(
                    availableTags, extractLast(request.term)));
            },
            focus: function() {
                // prevent value inserted on focus
                return false;
            },
            select: function(event, ui) {
                var terms = split(this.value);
                // remove the current input
                terms.pop();
                // add the selected item
                terms.push(ui.item.value);
                // add placeholder to get the comma-and-space at the end
                terms.push("");
                console.log(terms)
                console.log(terms.length)

                var tagTemplate = "";
                for (var i = 0; i < (terms.length - 1); i++) {
                    // console.log(terms[i])
                    tagTemplate += '<div class="filterLable"><p>' + terms[i] + '</p><span class="close-icon">X</span></div>';
                }
                $('.event-name').append(tagTemplate);
                event_names = $('.filterLable p').map(function() {
                    return $(this).text();
                }).get().join(',');
                $("#hidden-event-name").val(event_names);

                $('.close-icon').click(function() {
                    $(this).parent().remove();
                    event_names = $('.filterLable p').map(function() {
                        return $(this).text();
                    }).get().join(',');
                    $("#hidden-event-name").val(event_names);
                })
                console.log(this);
                $(this).val('');
                return false;
            }
        });

