$(document).ready(function() {
    var readURL = function(input) {
        if (input.files && input.files[0]) {
            var reader = new FileReader();
            reader.onload = function(e) {
                $('.profile-pic').attr('src', e.target.result);
            }

            reader.readAsDataURL(input.files[0]);
        }
    }


    $(".file-upload").on('change', function() {
        readURL(this);
    });

    $(".upload-button").on('click', function() {
        $(".file-upload").click();
    });

    $("#applyBtn").on('click', function() {
        $("#list-events-admin").DataTable().clear().destroy();
        $('#list-events-admin').dataTable({
            bJQueryUI: false,
            bProcessing: true,
            bServerSide: true,
            ajax: {
              url: "/admin/events/list",
              type: "POST",
              data: function(d) {
                return d.form = $("#filter_form").serializeArray();
              }
            }
          });
    });

    $(".edit-manage-fields input").focusout(function(){
    if($(this).val()!= ""){
       $(this).addClass('optional-field');
    }
    else{
        $(this).removeClass('optional-field');
    }

    });
     $(".edit-manage-fields textarea").focusout(function(){
    if($(this).val()!= ""){
       $(this).addClass('optional-field');
    }
    else{
        $(this).removeClass('optional-field');
    }

    });
    $(".edit-manage-fields").find("input , textarea ").each(function(){
        if($(this).val()!= ""){
           $(this).addClass('optional-field');
        }
    });
});

window.pressed = function() {
    var a = document.getElementById('aa');
    if (a.value == "") {
        fileLabel.innerHTML = "Choose file";
    } else {
        var theSplit = a.value.split('\\');
        fileLabel.innerHTML = theSplit[theSplit.length - 1];
        document.getElementById("previous_pic").style.display = "none";
    }
};
