$(document).ready(function(){ 
   $("#paypal-container").hide();
   $("#s-option-1").click(function() {
        $(".credit-card").hide();
        $("#paypal-container").show();
    });
    $("#s-option-2").click(function() {
        $(".credit-card").show();
        $("#paypal-container").hide();
    });
    //  $("#dLabel").click(function(){
    //     $("#notification-count").css("display", "none");
    // });
    $("#signup_sponsor").submit(function(e) {

    var ref = $(this).find("[required]");

    $(ref).each(function(){
        if ( $(this).val() == '' )
        {
            alert("Required field should not be blank.");

            $(this).focus();

            e.preventDefault();
            return false;
        }
    });  return true;
});
$(".event-code-enter").submit(function(e) {

    var ref = $(this).find("[required]");

    $(ref).each(function(){
        if ( $(this).val() == '' )
        {
            alert("Required field should not be blank.");

            $(this).focus();

            e.preventDefault();
            return false;
        }
    });  return true;
});
});

